import React from "react";






function Daily(props){
    return (
        <div className="daily">
        
       
       
        <br></br>
        <img  src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.nicepng.com%2Fourpic%2Fu2q8a9u2q8e6a9o0_weather-icon-weather%2F&psig=AOvVaw1HTQScsPjHCAfrPI6iNrS5&ust=1648825081331000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCKjCrqLO8PYCFQAAAAAdAAAAABAD" alt="icon"></img>
        <br></br>
        <p1  className="tempdailyhigh font">39°      </p1>
     
        <p1  className="tempdailylow font">21°</p1>
        <br>
        </br>
        <p1 className="font">Sunny</p1>
        

        </div>

    );


}
export default Daily;
